public void testDefaultValueWithoutSetting() throws Exception {
  // LUCENE-1805: make sure default get returns null,
  // twice in a row
  CloseableThreadLocal<Object> ctl = new CloseableThreadLocal<Object>();
  assertNull(ctl.get());
}

